package iosys;

public class SwapTwoNumberWithout3rd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=10, num2=20;
		
		num1=num1*num2;//200
		num2=num1/num2;//10
		num1=num1/num2;//20
		
		System.out.println("num1 ="+num1);
		System.out.println("num2 ="+num2);
	}

}
